import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useUser } from './App';
import axios from 'axios';

const LANGUAGES = [
  { code: 'en', label: 'English' },
  { code: 'es', label: 'Spanish' },
  { code: 'hi', label: 'Hindi' },
  { code: 'ja', label: 'Japanese' },
  { code: 'tl', label: 'Tagalog' },
  { code: 'ta', label: 'Tamil' },
];

const SKILL_LEVELS = [
  'Beginner',
  'Intermediate',
  'Advanced',
  'Native/Heritage Speaker'
];

const API = axios.create({ 
  baseURL: process.env.REACT_APP_API_URL || 'http://localhost:4000', 
  withCredentials: false 
});

API.interceptors.request.use(config => {
  const token = localStorage.getItem('jwt');
  if (token) {
    config.headers.Authorization = `Bearer ${token}`;
  }
  return config;
});

function Onboarding() {
  const { user, setUser } = useUser();
  const navigate = useNavigate();
  const [skill, setSkill] = useState('');
  const [language, setLanguage] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!skill || !language) {
      setError('Please select your skill level and target language.');
      return;
    }
    try {
      const response = await API.post('/api/user/onboarding', { skill, language });
      setUser(response.data.user);
      navigate('/dashboard');
    } catch (err) {
      setError('Failed to save onboarding. Please try again.');
    }
  };

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #f5f1ec 0%, #e8e0d8 50%, #d4c8c0 100%)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      padding: '2rem'
    }}>
      <form onSubmit={handleSubmit} style={{
        background: '#fff',
        borderRadius: 20,
        padding: '3rem',
        boxShadow: '0 20px 60px rgba(60,76,115,0.15)',
        maxWidth: 420,
        width: '100%',
        textAlign: 'center',
        position: 'relative',
        overflow: 'hidden'
      }}>
        <h2 style={{ color: '#3c4c73', fontSize: '2rem', fontWeight: 700, marginBottom: '2rem', fontFamily: 'Grandstander, Arial, sans-serif' }}>
          Welcome! Let's get to know you
        </h2>
        <div style={{ marginBottom: '2rem' }}>
          <label style={{ color: '#7e5a75', fontWeight: 600, fontSize: '1.1rem', display: 'block', marginBottom: 10 }}>
            What is your current skill level?
          </label>
          <select value={skill} onChange={e => setSkill(e.target.value)} style={{ width: '100%', padding: '0.8rem', borderRadius: 8, border: '1.5px solid #c38d94', fontSize: '1rem', marginBottom: 8 }}>
            <option value="">Select skill level</option>
            {SKILL_LEVELS.map(level => (
              <option key={level} value={level}>{level}</option>
            ))}
          </select>
        </div>
        <div style={{ marginBottom: '2rem' }}>
          <label style={{ color: '#7e5a75', fontWeight: 600, fontSize: '1.1rem', display: 'block', marginBottom: 10 }}>
            What language do you want to learn?
          </label>
          <select value={language} onChange={e => setLanguage(e.target.value)} style={{ width: '100%', padding: '0.8rem', borderRadius: 8, border: '1.5px solid #c38d94', fontSize: '1rem', marginBottom: 8 }}>
            <option value="">Select language</option>
            {LANGUAGES.map(lang => (
              <option key={lang.code} value={lang.code}>{lang.label}</option>
            ))}
          </select>
        </div>
        {error && <div style={{ color: '#dc3545', marginBottom: 16 }}>{error}</div>}
        <button type="submit" style={{
          width: '100%',
          padding: '1rem',
          borderRadius: 10,
          border: 'none',
          background: 'linear-gradient(135deg, #7e5a75 0%, #8a6a7a 100%)',
          color: '#fff',
          fontSize: '1.1rem',
          fontWeight: 600,
          cursor: 'pointer',
          transition: 'all 0.3s ease',
          marginTop: 8
        }}>
          Continue
        </button>
      </form>
    </div>
  );
}

export default Onboarding;
